import React, { useState, useEffect } from "react";
import "./superHome.css";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => { 
    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setLoading(false);
      });
  };

  const createCompany = () => {
    // Implement the logic for creating a new company here
    // You can show a form or send a request to the server
  };

  const createSuperUser = () => {
    // Implement the logic for creating a new SuperUser here
    // You can show a form or send a request to the server
  };
  const deleteUser = (id) => {
    if (window.confirm("Are you sure you want to delete this user?")) {
      // Send a request to the server to delete the user with the given ID
      fetch(`http://localhost:5000/deleteUser/${id}`, {
        method: "DELETE",
      })
        .then((response) => response.json())
        .then((result) => {
          if (result.status === "ok") {
            // Data is deleted, update the state or fetch data again
            fetchData();
          } else {
            // Handle error, show an alert or message
          }
        });
    }
  };

    return (
      <div>
        <div className="button-container">
          <button onClick={createCompany} className="btn btn-success">
            Create Company
          </button>
          <button onClick={createSuperUser} className="btn btn-primary">
            Create SuperUser
          </button>
        </div>
        {loading ? (
          <p>Loading...</p>
        ) : (
          <div>
            <table className="table table-striped table-bordered">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>First Name</th>
                  <th>Last Name</th>
                  <th>User Type</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {data.data.users.map((user) => (
                  <tr key={user._id}>
                    <td>{user._id}</td>
                    <td>{user.fname}</td>
                    <td>{user.lname}</td>
                    <td>{user.userType}</td>
                    <td
                      className="btn btn-danger"
                      onClick={() =>
                        alert(deleteUser)
                      }
                    >
                      {" "}
                      delete
                    </td>
                  </tr>
                ))}
                {data.data.companies.map((company) => (
                  <tr key={company._id}>
                    <td>{company._id}</td>
                    <td>{company.fname}</td>
                    <td>{company.lname}</td>
                    <td>{company.userType}</td>
                    <td
                      className="btn btn-danger"
                      // onClick={() => deleteCompany(company.id, company.email)}
                    >
                      {" "}
                      delete
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    );
  };
